userDefinedLinkHintCss:
div > .vimiumHintMarker {
  background: none;
  border: none;
  background-color: rgba(0, 0, 0, 0.75);
  box-shadow: 0 1px 4px rgba(0, 0, 0, 0.35);
  padding: 2px 6px;
}

div > .vimiumHintMarker span {
  /* linkhint text */
  font-size: 12px;
  color: #ddd;
  text-shadow: none;
}

div > .vimiumActiveHintMarker span {
  color: hsl(0, 85%, 65%) !important;
}
